{:id "da6b9c4d5dd0deeae15ef9abcb07cc0e0a92d802f7c8692faaf5b6cbf8c71571", :t 11020517, :link "http://www.siggibecker.de/noj923yeah/2016/02/02/grosses-breitmaulgrinsen-mit-connectedtext/", :title "Großes Breitmaulgrinsen mit ConnectedText", :more "<p>In Thunderbird Mail-Export als Reintext in ein Verzeichnis. Ergebnis: Jede Mail eine Txt-Datei. In ConnectedText Import dieser Dateien zu je einem eigenen Topic. Voila! Alles wunderbar durchwühlbar mit der Volltextsuche, statt dieser kryptischen Darstellung in Thunderbird. Bonus: Wenn man seit Jahren aus Google Reader und später aus Feedly sich selbst jeden interessanten Artikel oder Blogpost <a href='http://www.siggibecker.de/noj923yeah/2016/02/02/grosses-breitmaulgrinsen-mit-connectedtext/' class='excerpt-more'>[...]</a></p>"}
{:id "964cc93c9c983ac48e378c05850ca323ec83107940d9494d05ba950e0723b453", :t 10782848, :link "http://www.siggibecker.de/noj923yeah/2016/01/30/schoepferisch-leben/", :title "Schöpferisch leben", :more "<p>Das Gefühl, nein der innere Aufschrei, warum bin ich nicht drauf gekommen, sollte lediglich ein Ansporn sein, dem Schwindel zu trauen, der einen im Moment wahrer Kreativität ergreift. Wirklich gelebt gleiten wir von Schwindel zu Schwindel. Ursprung</p>"}
{:id "0f701c6a2cd5695c36a58e132a29124f83fd226c3ec3339b9072fb39a1be4302", :t 10781693, :link "http://www.siggibecker.de/noj923yeah/2016/01/30/eine-feine-differenz/", :title "Eine feine Differenz", :more "<p>Eine feine Differenz. Eine feine Differenz aktiert zwischen dem ektophanen und dem brüllierenden. Nur dem aufmerksamen Mitschwinger ist es gegeben existentiell zur Seite zu kotzen, so diese Differenz sich ins Gemüt drängt. Aber wie kontraagieren, wenn Heini kloppiert und strahlomannt?</p>"}
{:id "d96437fcdbe094ff83db5948d525d2f91040130fd85dfa133ccf8d7c1bc2577d", :t 10694259, :link "http://www.siggibecker.de/noj923yeah/2016/01/29/connectedtext/", :title "ConnectedTExt", :more "<p>Hände weg von Zettelkasten (extra kein Link). Dead end. Nach jahrelangem Ausprobieren diverser Textsammelprogramme bin ich vor einger Zeit bei ConnectedText gelandet und hab es vor einer Woche schliesslich erstanden. Für den Leistungsumfang spottbillig. Die Lernkurve ist etwas schräg, aber Geschwindigkeit und Funktionalität überzeugen. Für die Neugierigen lass ich ausnahmsweise hier die Kommentare auf.</p>"}
